import "./styles/App.css";
import Header from "./components/Header";
import Maps from "./components/Maps";
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route>
            <Header />
          </Route>
          <Route path="/test">
            <Maps />
          </Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}
export default App;
